// Fireworks.js
import React from 'react';
import './fireworks.css';

const Fireworks = () => {
    // Replace with your actual image URLs
    const images = [
        'https://c4.wallpaperflare.com/wallpaper/157/340/999/car-sports-car-supercar-lamborghini-aventador-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/404/19/616/dark-car-vehicle-ford-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/383/154/335/car-khyzyl-saleem-mazda-rx-7-simple-background-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/956/868/1012/car-nissan-race-cars-road-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/193/556/883/car-neon-chevrolet-corvette-race-cars-hd-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/872/505/291/bmw-bmw-m4-car-cyan-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/825/184/17/car-vehicle-super-car-supercars-wallpaper-preview.jpg',
        'https://c4.wallpaperflare.com/wallpaper/922/163/628/digital-art-car-neon-porsche-wallpaper-preview.jpg',
    ];

    return (
        <div className="fireworks-grid">
            {images.map((image, index) => (
                <div key={index} className="fireworks-item">
                    <img src={image} alt={`Fireworks ${index + 1}`} />
                </div>
            ))}
        </div>
    );
};

export default Fireworks;
